export const CUSTOM_EVENT_TYPE = {
  RELOAD_TASKS:"reloadTasks",
  RELOAD_CURRENT_TASK:"reloadCurrentTask",
  CUSTOM_SUBMIT_DONE:"customSubmitDone",
  ACTION_COMPLETE:"actionComplete",
  CANCEL_SUBMISSION:"cancelSubmission"
};
